import React from 'react'
import {useParams} from 'react-router-dom'

import './Nav.css'
import Video from './Video'

import './AdminVideo.css'



export const AdminVideoSelected = ({state}) => {

 
    let slug = useParams()

    console.log(slug.slug)

    const allVideo=Object.keys(state.video)
                .map(items =>
                    {
                        console.log(items,slug)
                        if(items==slug.slug){
                            return
                                <Video key={items} 
                                    id={items}
                                    name={state.video[items].nom}
                                    url={state.video[items].url}
                                    tag={state.video[items].tag}
                                    vue={state.video[items].vue}
                                    like={state.video[items].like}
                                />
                        }
                })
   
    return (
        <div className='cards'>
            <h2>in AdminVideoSelected sur {slug.slug}</h2>
           {allVideo}
        </div>
    )
}


export default AdminVideoSelected
